css:
.settings-view .package-readme {
  font-size: 1.25em;
}
.settings-view .package-readme h1 {
  font-size: 2em;
  margin-top: 1.5em;
}
.settings-view .package-readme h2 {
  font-size: 1.75em;
  margin-top: 1.5em;
}
.settings-view .package-readme h3 {
  font-size: 1.5em;
  margin-top: 1.75em;
}
.settings-view .package-readme h4 {
  font-size: 1.25em;
  margin-top: 1.25em;
}
.settings-view .package-readme h1,
.settings-view .package-readme h2,
.settings-view .package-readme h3,
.settings-view .package-readme h4 {
  color: hsl(230, 1%, 14%);
}
.settings-view .package-readme a {
  color: hsl(208, 100%, 54%);
}
.settings-view .package-readme hr {
  border-color: hsl(230, 1%, 56%);
}
.settings-view .package-readme blockquote {
  border-left-color: hsl(230, 1%, 56%);
}
.settings-view .package-readme pre {
  margin-bottom: 1em;
}
.settings-view .package-readme img {
  max-width: 100%;
}
.settings-view .package-readme table {
  display: block;
  margin-bottom: 1em;
  width: 100%;
  overflow: auto;
  word-break: normal;
}
.settings-view .package-readme table th {
  font-weight: bold;
  text-align: center;
}
.settings-view .package-readme table th,
.settings-view .package-readme table td {
  padding: 6px 13px;
  border: 1px solid hsl(230, 1%, 86%);
}
.settings-view .package-readme table tr {
  border-top: 1px solid hsl(230, 1%, 86%);
  background-color: hsl(230, 1%, 98%);
}
.settings-view .package-readme table tr:nth-child(2n) {
  background-color: hsl(230, 1%, 90%);
}
.settings-view .package-readme kbd {
  display: inline-block;
  padding: 0.3em 0.4em;
  font-size: 0.8em;
  line-height: 1;
  color: hsl(230, 1%, 14%);
  vertical-align: middle;
  background-color: hsl(0, 0%, 100%);
  border: solid 1px hsl(230, 1%, 86%);
  border-bottom-color: hsl(230, 1%, 76%);
  border-radius: 3px;
  box-shadow: inset 0 -1px 0 hsl(230, 1%, 76%);
}
